        "Title": "星与夜的低语",
        "IT": "丝柯克",
        "Tab": "UI_LegendQuestImg_SkirkNew",
        "Icon": "UI_ChapterIcon_SkirkNew",
        "Intro": "星汉迢迢，光阴漫漫，遥远的宇宙寄托着无数人的期待。<br>但每当梦想碰撞，便会传来碎裂的声音。美丽的夜幕，也是无数文明的残骸。<br>幸福与不幸纠缠不休，在时间的锻打下熔淬成一体。是历史与未来，也是此刻的人生。"
