        "Tab": "UI_LegendQuestImg_Mizuki",
        "Icon": "UI_ChapterIcon_Mizuki",
        "Intro": "稻妻民间流传着一种这样的说法——运气好的话，你可以在昏昏欲睡时看到某种圆滚滚的可爱生物。这时，你最好放下手中的事情尽快进入梦乡，因为这种生物便是名为食梦貘的妖怪，她会趁你熟睡时一口吃掉你的噩梦。<br>不过，现在的稻妻人想要享受这种服务并不需要等待好运气的降临，他们只要前往稻妻城的秋沙钱汤预约心理诊疗即可。据说这里的心理诊疗师都是食梦貘化形而成的少女，许多被噩梦纠缠的顾客都在这里得到了解脱。<br>但是，原本生意兴隆的秋沙钱汤似乎正在遭遇一场严重的经营危机。而要了解个中原委，你先要经历一场梦中的邂逅…"
