        "Icon": "UI_ChapterIcon_Nahida",
        "Intro": "「虚空」停止运转，学城对智慧的追求不再狂热，须弥民众也迎回了做梦的权利。<br>一时间，梦的话题在须弥城的街头巷尾复苏，大家都对这位曾经的「老朋友」产生了新鲜感。<br>就连不苟言笑的鳄鱼都有打哈欠的时候，旅行者也大可放松一下，去听听他们的闲聊吧。"
